			"label": "mortimer_mole",
			"on_talk": "[if((not level.player.vars.stored_events['mortimer_state']),	
	  speech_dialog(level.player.store_event('mortimer_state', 'wants_ant'),
	                self, [~Hello there.~],
							set(level.player.animation, 'emote_raisedfinger'),
							level.player, [~Hi, I'm Frogatto.~],
							self, [~A pleasure to meet you.\\nI am Mortimer.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~That's nice.~],
										set(level.player.animation, 'emote_confused'),
										[~Uhm, I hope you don't mind my asking,\\nbut what on earth ARE you, anyway?~],
							self, [~Ostensibly, I am a mole.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~...\\nOkay.~],
							self, [~Perhaps more importantly, I am a bit of\\nan astronomer and biologist, by trade.~],
									[~That is why I live all the way up here.\\nYou can see quite a bit from this height.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~...and I guess you have these\\nants in cages to study them?~],
							self, [~That's right.  Unfortunately,\\nmy collection lacks the rarer golden ant.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~Oh, what a shame.~],
							self, [~You know, you look rather well-traveled.\\nIf you could bring me a golden ant\\nand stick it in one of my cages,\\nI'd reward you handsomely.~],
							set(level.player.animation, 'emote_raisedfinger'),
							level.player, [~Handsomely you say?\\nI'm on it!~])),
	if(level.player.vars.stored_events['mortimer_state'] = 'wants_ant',
	   if(level.player.vars.stored_events['got_gold_ant'] = 1,
	    speech_dialog(self, [~Oh! You got the golden ant for me.\\nIt's beautiful, beautiful!~],
		              set(level.player.animation, 'emote_geez'),
		              level.player, [~Mmmmmhmmmm.\\nNow you were talking about a reward?~],
					  self, [~Yes, yes, a reward!\\nI think I have just the thing.~],
					  [~Some time ago, I bartered my way\\ninto the possession of an Energy Talisman.~],
					  [~A most interesting artifact, but I think\\nI've exhausted what I can learn from it.~],
					  [~It's not useful to me, anymore,\\nand I think it could be very useful to you.~],
					  [~If I am correct, I believe it would\\nreact with your anatomy by allowing you\\nto externally manifest energy.~],
					  [~That is, taking your inner physical energy,\\nand allowing you to directly channel\\nit outside your body.~],
					  [~You'll have to try it to see exactly\\nwhat happens, but I'm sure something will.~],
					  [~Good luck,\\nand I hope it serves you well!~],
					  level.player.store_event('mortimer_state', 'got_ant'),
					  spawn('ability',level.player.mid_x,level.player.y-200,1, [set(child.kind,'energyshot'),fire_event(child,'acquired')])
					  
					  ),
		if(level.player.vars.swallowed and level.player.vars.swallowed.type in ['ant_gold', 'ant_gold.thrown'],
		speech_dialog(self, [~Oh my! If that's a golden ant in your stomach,\\nthen quick, spit it out into the cage!~]),
		speech_dialog(self, [~I don't suppose you've had any\\nluck with getting a golden ant yet?~],
		              set(level.player.animation, 'emote_geez'),
		              level.player, [~I'm working on it.\\nThose things pack a pretty mean bite, you know.~]
	   )))),
	 if(level.player.vars.stored_events['mortimer_state'] = 'got_ant',
	   speech_dialog(self, [~I do hope you are enjoying exploring the island.\\nThere are so many wonderful creatures on it.~],
					 set(level.player.animation, 'emote_geez'),
		             level.player, [~... most of which seem inclined to kill me.~]))
	]",
